ApiEndpointBase.ApiEndpointBase.description:
Declares single point of dispatching HTML5 EventSource messages using `text/event-stream` content type to avoid WebKit limitations. 
This class works as client-side complementary component to class `EventSourceDispatcher.EventSourceDispatcher`.
WebKit engine currently supports up to 5 parallel `EventSource` sources. This can be avoided by declaring one common source and dispatching 
messages based on identificator. To receive push messages from server use `addIviEventSourceListener` method:

    addIviEventSourceListener(8088, "mysource", function(aMessage) { 
      // Process message
    });

AudioService.AudioService.description:
Declares Audio Service API which provides methods to one audio resource from multiple frontend application demonstrating this concept .
Notification are sent to listeners by HTML5 `EventSource` mechanism available in class `ThemeEngine.addStatusListener` e.g.:

    var audioService = new AudioService ();   
    audioService.addStatusListener(function (data) { 
        // Process changes
    });

CarIndicatorService.CarIndicatorService.description:
`/carIndicator`

API provides access to stub indicators for car status. This should be replaced by access to real CAN bus and other sensors in later phases. API also supports option to send randomized data
to demonstrate real-time updates via `setRandomizer` method. Notification are sent to listeners by 
HTML5 `EventSourc`e mechanism available in class `CarIndicator.addStatusListener`, e.g.:

    var carIndicator = new CarIndicator ();   
    carIndicator.addStatusListener(function (data) { 
        // Process status change
    });

ThemeEngineService.ThemeEngineService.description:
`/themeEngine`

Declares Theme Engine API which provides methods to operate with Car and User themes.
Notification are sent to listeners by HTML5 `EventSource` mechanism available in class `ThemeEngine.addStatusListener` e.g.:

    var themeEngine = new ThemeEngine ();   
    themeEngine.addStatusListener(function (data) { 
        // Process theme change
    });

Themes are provided on two levels:

* Car model theme (e.g. Opel Insignia, Opel Astra) utilizing car model-specific graphical assets matching real appearance inside car (e.g. leather pattern, color theme inside car etc.).
* User theme (e.g. Retro, Fluid) defining e.g. layouts of controls, borders, font sizes, colors etc.

Theme package is a ZIP file which must include `theme.json` file in package root level containing package metadata:

	{
		"id": "http://com.intel.tizen/coulomb.2012", // Theme ID as will be recognized by IVI engine
	    "version": "0.5.0",                          // Theme version
		"name": "Intel Coulomb 2012",                // Human-friendly name
		"type": "car"                                // Theme type
	}

Depending on theme type theme package *MUST* provide following files in package root level:

* Car model theme - `car.css` and `car.js`
* User theme - `user.css` and `user.js`
